import React from "react";
import ReactDOM from "react-dom";
import { Route, Link, BrowserRouter as Router } from "react-router-dom";
import CreatePurchase from "./components/createPurchase";
import ViewPurchase from "./components/viewPurchase";
import "bootstrap/dist/css/bootstrap.css";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";

const routing = (
  <Router>
    <div>
      <br></br>
      <br></br>
      <ul>
        <li>
          <Link to="/createPurchase">Home</Link>
        </li>
        <li>
          <Link to="/createPurchase">Create Purchase</Link>
        </li>
        <li>
          <Link to="/ViewPurchase">ViewPurchase</Link>
        </li>
      </ul>

      <Route path="/" component={App} />
      <Route exact path="/createPurchase" component={CreatePurchase} />
      <Route path="ViewPurchase" component={ViewPurchase} />
    </div>
  </Router>
);
ReactDOM.render(routing, document.getElementById("root"));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
